DROP VIEW IF EXISTS `authgroup`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `authgroup` AS select `tp_auth_group`.`id` AS `id`,`tp_auth_group`.`title` AS `title`,`tp_auth_group`.`status` AS `status`,`tp_auth_group`.`create_time` AS `create_time`,`tp_auth_group`.`update_time` AS `update_time`,group_concat(`tp_menu`.`title` separator ',') AS `rules` from (`tp_auth_group` join `tp_menu` on(find_in_set(`tp_menu`.`id`,`tp_auth_group`.`rules`))) where isnull(`tp_auth_group`.`delete_time`) group by `tp_auth_group`.`id` order by `tp_auth_group`.`id`;

